export function Header({appTitle}) {
    return (
        <>
            <span></span>
            <button><span></span></button>
        </>
    )
}

import { storeToRefs } from 'pinia'
import { authStores, initialize } from '../stores/authStores'

const useAuthStores = authStores()
const { userId, status } = storeToRefs(authStores())

// Lifecycle
onMounted( async () => {
    initialize()
    await useAuthStores.checkCurrentStatus()
})

// Computed 
const label = computed(() => useAuthStores.status ? 'Sign Out' : 'Sign In')

// Public Methods
async function signInOut() {
    if (!useAuthStores.status) { 
        await useAuthStores.signIn()
        console.log("signing in")
    } else if (useAuthStores.status) { 
        await useAuthStores.signOut()
        console.log("signing out")        
    }
    try {await useAuthStores.updateUserId}
    catch (error) { console.log(error) }
}
